import React from 'react';
import Links from './Links';
import './Header.css';

// this component will render a header component for each page

class Header extends React.Component {
    constructor(props) {
        super(props);
        this.isHome = this.isHome.bind(this);
    }
    render() {
        return (
            <header>
                <nav className="navbar navbar-expand-sm navbar-light bg-light">
                    <a className="navbar-brand" href="/">The Wax Scraper | Skiing News Aggregator</a>
                    <div className="collapse navbar-collapse" id="navbarNav">
                        <ul className="navbar-nav">
                            <Links isActive={this.props.toggleActive}/>
                        </ul>
                    </div>
                </nav>
            </header>
        );
    }
}

export default Header;
